import "./section1.css";

function Section1() {
  return (
    <div>
      <section className="tela-2">
        <div className="box-1">
          <h1 className="titulo-pg">
            Amplie o seu <br /> negócio!
            <p className="paragrafo1">
              Tem uma <strong>ideia</strong>,<strong> serviço</strong> ou <br />
              <strong>produto</strong>? <br />
              Faça seu <strong>site</strong> com a gente!
              <button className="box-2">
                <a href="https://forms.gle/8JE8y95muRiirWfF8" target="_blank"> Quero meu site</a>
              </button>
            </p>
          </h1>
        </div>

        <div></div>
